import React from "react";
import { styled } from "styled-components";

const GNBWrap = styled.nav`
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 70px;
  border-bottom: 1px solid #000;
  background-color: #090b13;
  display: flex;
  justify-contents: space-between;
  padding: 0 36px;
  letter-spacing: 16px;
  z-index: 3;
  color: white;
`;
const Logo = styled.div`
  display: inline-block;
  width: 80px;
  max-height: 70px;
  padding: 0;
  margin-top: 4px;
  font-size: 0;
  > img {
    display: block;
    width: 100%;
  }
`;

const GNB = () => {
  return (
    <GNBWrap>
      <Logo>
        <img
          src="/images/logo.svg"
          alt="Disney Plus Logo"
          onClick={() => {
            window.location.href = "/";
          }}
        />
      </Logo>
    </GNBWrap>
  );
};

export default GNB;
